Now that we have got a working installation, let us get right into it! At the very least, we need to create an Application instance with an application id . For that we use the builder pattern which many gtk-rs objects support. Filename: listings/hello_world/1/main.rs use gtk::prelude::*;
use gtk::Application; fn main() { // Create a new application let app = Application::builder() .application_id("org.gtk-rs.example") .build(); // Run the application app.run();
} It builds fine, but nothing appears on our screen. GTK warns us that something should be called in its activate step. So let us create a window there. Filename: listings/hello_world/2/main.rs use gtk::prelude::*;
use gtk::{Application, ApplicationWindow}; fn main() { // Create a new application let app = Application::builder() .application_id("org.gtk-rs.example") .build(); // Connect to "activate" signal of `app` app.connect_activate(build_ui); // Run the application app.run();
} fn build_ui(app: &Application) { // Create a window and set the title let window = ApplicationWindow::builder() .application(app) .title("My GTK App") .build(); // Present window window.present();
} That is better! Normally we expect to be able to interact with the user interface. Also, the name of the chapter suggests that the phrase "Hello World!" will be involved. Filename: listings/hello_world/3/main.rs # use gtk::prelude::*;
