GObjects rely heavily on inheritance. Therefore, it makes sense that if we want to create a custom GObject, this is done via subclassing. Let us see how this works by replacing the button in our "Hello World!" app with a custom one. First, we need to create an implementation struct that holds the state and overrides the virtual methods. It is advised to keep it in a private module, since its state and methods are only meant to be used by the GObject itself. It therefore corresponds to the private section of objects in languages like Java and C++. Filename: listings/gobject_subclassing/1/custom_button/imp.rs use gtk::glib;
use gtk::subclass::prelude::*; // Object holding the state
#[derive(Default)]
pub struct CustomButton; // The central trait for subclassing a GObject
#[glib::object_subclass]
impl ObjectSubclass for CustomButton { const NAME: &'static str = "MyGtkAppCustomButton"; type Type = super::CustomButton; type ParentType = gtk::Button;
} // Trait shared by all GObjects
impl ObjectImpl for CustomButton {} // Trait shared by all widgets
impl WidgetImpl for CustomButton {} // Trait shared by all buttons
impl ButtonImpl for CustomButton {} The description of the subclassing is in ObjectSubclass. NAME should consist of crate-name, module-path and object-name in order to avoid name collisions. Use PascalCase here. Type refers to the actual GObject that will be created afterwards. ParentType is the GObject we inherit of. After that, we would have the option to override the virtual methods of our ancestors. Since we only want to have a plain button for now, we override nothing. We still have to add the empty impl though. Next, we describe our custom GObject. Filename: listings/gobject_subclassing/1/custom_button/mod.rs mod imp; use glib::Object;
use gtk::glib; glib::wrapper! { pub struct CustomButton(ObjectSubclass<imp::CustomButton>) @extends gtk::Button, gtk::Widget, @implements gtk::Accessible, gtk::Actionable, gtk::Buildable, gtk::ConstraintTarget;
} impl CustomButton { pub fn new() -> Self { Object::new(&[]).expect("Failed to create `CustomButton`.") } pub fn with_label(label: &str) -> Self { Object::new(&[("label", &label)]).expect("Failed to create `CustomButton`.") }
}
# # impl Default for CustomButton {
# fn default() -> Self {
# Self::new()
# }
# } glib::wrapper! does the most of the work of subclassing for us. Coming from most other languages you would probably expect that you only have to mention the base class you want to inherit from. However, as of today, subclassing of GObjects in Rust requires to mention all ancestors and interfaces apart from GObject and GInitiallyUnowned. For gtk::Button, we can look them up in the corresponding doc page of GTK4. After these steps, nothing is stopping us anymore from replacing gtk::Button with our CustomButton. Filename: listings/gobject_subclassing/1/main.rs mod custom_button; use custom_button::CustomButton;
use gtk::prelude::*;
