A Variant is used whenever data needs to be serialized, for example for sending it to another process or over the network, or for storing it on disk. In that sense, a Variant is similar to a Rust object that implements serde::Serialize and serde::Deserialize . It would be possible to add derive macros similar to the ones of serde for serializing/deserializing arbitrary Rust structs. It is just that nobody did the work yet. Pull requests to add this functionality would be very appreciated! Although GVariant supports arbitrarily complex types, the Rust bindings are currently limited to bool, u8, i16, u16, i32, u32, i64, u64, f64, &str/String, and VariantDict . Containers of the above types are possible as well, such as HashMap, Vec, Option, tuples up to 16 elements, and Variant. These can even be arbitrarily nested like e.g. HashMap<Option<u32>, Vec<HashMap<String, Variant>>>. In the most simple case, converting Rust types to Variant and vice-versa is very similar to the way it worked with Value. Filename: listings/gobject_values/2/main.rs # use gtk::prelude::*;
