Quite often, we want the window state to persist between sessions. If the user resizes or maximizes the window, they might expect to find it in the same state the next time they open the app. GTK does not provide this functionality out of the box, but luckily it is not too hard to manually implement it. We basically want two integers (height & width) and a boolean (is_maximized) to persist. We already know how to do this by using Settings. Filename: listings/saving_window_state/1/org.gtk-rs.example.gschema.xml <?xml version="1.0" encoding="utf-8"?>
<schemalist> <schema id="org.gtk-rs.example" path="/org/gtk-rs/example/"> <key name="window-width" type="i"> <default>-1</default> <summary>Default window width</summary> </key> <key name="window-height" type="i"> <default>-1</default> <summary>Default window height</summary> </key> <key name="is-maximized" type="b"> <default>false</default> <summary>Default window maximized behaviour</summary> </key> </schema>
</schemalist> Since we do not care about intermediate state, we only load the window state when the window is constructed and save it when we close the window. That can be done by creating a custom window. First, we create one and add methods for getting and setting the window state. Filename: listings/saving_window_state/1/custom_window/mod.rs # mod imp;
# # use glib::Object;
# use gtk::prelude::*;
# use gtk::subclass::prelude::*;
# use gtk::Application;
# use gtk::{gio, glib};
# glib::wrapper! { pub struct Window(ObjectSubclass<imp::Window>) @extends gtk::ApplicationWindow, gtk::Window, gtk::Widget, @implements gio::ActionGroup, gio::ActionMap, gtk::Accessible, gtk::Buildable, gtk::ConstraintTarget, gtk::Native, gtk::Root, gtk::ShortcutManager;
} impl Window { pub fn new(app: &Application) -> Self { // Create new window Object::new(&[("application", app)]).expect("Failed to create `Window`.") } pub fn save_window_size(&self) -> Result<(), glib::BoolError> { // Get `settings` from `imp::Window` let settings = &self.imp().settings; // Get the size of the window let size = self.default_size(); // Set the window state in `settings` settings.set_int("window-width", size.0)?; settings.set_int("window-height", size.1)?; settings.set_boolean("is-maximized", self.is_maximized())?; Ok(()) } fn load_window_size(&self) { // Get `settings` from `imp::Window` let settings = &self.imp().settings; // Get the window state from `settings` let width = settings.int("window-width"); let height = settings.int("window-height"); let is_maximized = settings.boolean("is-maximized"); // Set the size of the window self.set_default_size(width, height); // If the window was maximized when it was closed, maximize it again if is_maximized { self.maximize(); } }
} The implementation struct holds the settings. We also override the constructed and close_request methods, where we load or save the window state. Filename: listings/saving_window_state/1/custom_window/imp.rs # use gio::Settings;
# use glib::signal::Inhibit;
# use gtk::{gio, glib};
# use gtk::{subclass::prelude::*, ApplicationWindow};
# pub struct Window { pub settings: Settings,
} #[glib::object_subclass]
impl ObjectSubclass for Window { const NAME: &'static str = "MyGtkAppWindow"; type Type = super::Window; type ParentType = ApplicationWindow; fn new() -> Self { Self { settings: Settings::new("org.gtk-rs.example"), } }
}
impl ObjectImpl for Window { fn constructed(&self, obj: &Self::Type) { self.parent_constructed(obj); // Load latest window state obj.load_window_size(); }
}
impl WidgetImpl for Window {}
impl WindowImpl for Window { // Save window state right before the window will be closed fn close_request(&self, obj: &Self::Type) -> Inhibit { if let Err(err) = obj.save_window_size() { log::error!("Failed to save window state, {}", &err); } // Do not inhibit the default handler Inhibit(false) }
}
impl ApplicationWindowImpl for Window {} That is it! Now our window retains its state between app sessions. Please note how we handle a failure in saving into the settings. We do not want to panic for recoverable errors. We might also not want to present all problems at the GUI. In our case we could not even do this, because the window will be immediately closed after the error occurs. Logging is the standard way of handling a situation like this. For that, we need to add the log crate and one of its front-ends, such as pretty_env_logger, to our dependencies. Filename: listings/Cargo.toml [dependencies]
