Until now, whenever we constructed pre-defined widgets we relied on the builder pattern . As a reminder, that is how we used it in our trusty "Hello World!" app. Filename: listings/hello_world/3/main.rs use gtk::prelude::*;
use gtk::{Application, ApplicationWindow, Button}; fn main() { // Create a new application let app = Application::builder() .application_id("org.gtk-rs.example") .build(); // Connect to "activate" signal of `app` app.connect_activate(build_ui); // Run the application app.run();
} fn build_ui(app: &Application) { // Create a button with label and margins let button = Button::builder() .label("Press me!") .margin_top(12) .margin_bottom(12) .margin_start(12) .margin_end(12) .build(); // Connect to "clicked" signal of `button` button.connect_clicked(move |button| { // Set the label to "Hello World!" after the button has been clicked on button.set_label("Hello World!"); }); // Create a window let window = ApplicationWindow::builder() .application(app) .title("My GTK App") .child(&button) .build(); // Present window window.present();
} Creating widgets directly from code is perfectly fine. However, with most toolkits you can describe your user interface with a markup language and GTK is no exception here. For example the following xml snippet describes the window widget of the "Hello World!" app. Filename: listings/interface_builder/1/window.ui <?xml version="1.0" encoding="UTF-8"?>
