By now, we have already learned many ways to glue our widgets together. We can send messages through channels, emit signals, share reference-counted state and bind properties. Now, we will complete our set by learning about actions. An action is a piece of functionality bound to a certain GObject. Let us check out the simplest case where we activate an action without a parameter. Filename: listings/actions/1/main.rs # use gio::SimpleAction;
