# app.connect_activate(build_ui);
# # // Set keyboard accelerator to trigger "win.close".
# app.set_accels_for_action("win.close", &["<primary>W"]);
# # // Run the application
# app.run();
# }
# fn build_ui(app: &Application) { // Create a window and set the title let window = ApplicationWindow::builder() .application(app) .title("My GTK App") .width_request(360) .build(); // Add action "close" to `window` taking no parameter let action_close = SimpleAction::new("close", None); action_close.connect_activate(clone!(@weak window => move |_, _| { window.close(); })); window.add_action(&action_close); // Present window window.present();
} First, we created a new gio::SimpleAction which is named "close" and takes no parameter. We also connected a callback which closes the window. Filename: listings/actions/1/main.rs # use gio::SimpleAction;
