Since we use Settings, our filter state will persist between sessions. However, the tasks themselves will not. Let us implement that. We could store our tasks in Settings, but it would be inconvenient. When it comes to serializing and deserializing nothing beats the crate serde . Combined with serde_json we can save our tasks as serialized json files First, we extend our Cargo.toml with the serde and serde_json crate. [dependencies]
serde = { version = "1.0", features = ["derive"] }
serde_json = "1.0" Serde is a framework for serializing and deserializing Rust data structures. The derive feature allows us to make our structures (de-)serializable with a single line of code. We also use the rc feature so that Serde can deal with std::rc::Rc objects. This is why we stored the data of TodoObject in a distinct TodoData structure. Doing so allows us to derive Serialize and Deserialize for TodoData. Filename: listings/todo_app/2/todo_object/mod.rs # mod imp;
