When you want to modify the style of your website, you use CSS . Similarly, GTK supports its own variant of CSS in order to style your app. We will not explain every piece of syntax used in this chapter. If you are new to CSS or just need a refresher, have a look at the MDN Web Docs . Let us say we have a button and we want to set its font color to magenta. Every type of widget has a corresponding CSS node. In the case of gtk::Button, this node is called button. Therefore, we create a style.css file with the following content: Filename: listings/css/1/style.css button { color: magenta;
} Next, we need to load the CSS file in the startup step of the application. As usual, the widgets are created during the "activate" step. Filename: listings/css/1/main.rs # use gdk::Display;
# use gtk::gdk;
# use gtk::prelude::*;
# use gtk::{Application, ApplicationWindow, Button, CssProvider, StyleContext};
# fn main() { // Create a new application let app = Application::builder() .application_id("org.gtk-rs.example") .build(); // Connect to signals app.connect_startup(|_| load_css()); app.connect_activate(build_ui); // Run the application app.run();
} fn load_css() { // Load the CSS file and add it to the provider let provider = CssProvider::new(); provider.load_from_data(include_bytes!("style.css")); // Add the provider to the default screen StyleContext::add_provider_for_display( &Display::default().expect("Could not connect to a display."), &provider, gtk::STYLE_PROVIDER_PRIORITY_APPLICATION, );
} fn build_ui(app: &Application) { // Create button let button = Button::builder() .label("Press me!") .margin_top(12) .margin_bottom(12) .margin_start(12) .margin_end(12) .build(); // Create a new window and show it let window = ApplicationWindow::builder() .application(app) .title("My GTK App") .child(&button) .build(); window.show();
} When we now run the app, we notice that our button and the "close" button are magenta. Probably not what we wanted, but that is what our CSS snippet does. We did not specify for which button the rule should apply, so it was applied to both of them. The GtkInspector comes in quite handy (not only) when playing with CSS. Make sure that the window of your app is focused and press Ctrl + Shift + D. A window will pop up which lets you browse and even manipulate the state of your app. Open the CSS view and override the button color with the following snippet. button { color: blue;
} With the pause button you can toggle whether your CSS code is active or not.

