In the previous examples, a widget always corresponded to a single CSS node. This is not always the case. For example, gtk::MenuButton has multiple CSS nodes. Let us see how that works. First, we create a single MenuButton. Filename: listings/css/8/window/window.ui <?xml version="1.0" encoding="UTF-8"?>
