</interface> You can make a MenuButton show an icon or a label. If you choose to do neither of those, as we currently do, it shows an image displaying an arrow. An inheritance tree of CSS nodes displays this situation: menubutton
╰── button.toggle ╰── <content> ╰── [arrow] We see that the menubutton node has children, which themselves have children and attached style classes. Now we know that we have to add a CSS rule that applies to the arrow node, which is a descendant of menubutton. Filename: listings/css/8/style.css menubutton arrow { color: magenta;
} Indeed, we get a MenuButton with a magenta arrow.

