Now that we know how to use CSS, it is time to update our To-Do app. Before, the individual tasks were a bit hard to distinguish. It would be nice if the todo rows would be surrounded by borders. Let us add that! The class TodoRow inherits from gtk::Box, so we could just match for the node box. However, if we create a custom widget we might as well give it its own CSS name. Keep in mind, that this is not the same as when we gave a specific instance of a widget a name. When calling set_css_name , we change the name of the CSS node of a widget. In our case, the widget TodoRow now corresponds to the node todo-row. Filename: listings/todo_app/3/todo_row/imp.rs # use glib::Binding;
# use gtk::prelude::*;
# use gtk::subclass::prelude::*;
# use gtk::{glib, CheckButton, CompositeTemplate, Label};
# use std::cell::RefCell;
# # // Object holding the state
# #[derive(Default, CompositeTemplate)]
# #[template(file = "todo_row.ui")]
# pub struct TodoRow {
# #[template_child]
# pub completed_button: TemplateChild<CheckButton>,
# #[template_child]
# pub content_label: TemplateChild<Label>,
# // Vector holding the bindings to properties of `TodoObject`
# pub bindings: RefCell<Vec<Binding>>,
# }
# // The central trait for subclassing a GObject
#[glib::object_subclass]
impl ObjectSubclass for TodoRow { // `NAME` needs to match `class` attribute of template const NAME: &'static str = "TodoRow"; type Type = super::TodoRow; type ParentType = gtk::Box; fn class_init(klass: &mut Self::Class) { Self::bind_template(klass); klass.set_css_name("todo-row"); } fn instance_init(obj: &glib::subclass::InitializingObject<Self>) { obj.init_template(); }
}
# # // Trait shared by all GObjects
# impl ObjectImpl for TodoRow {}
# # // Trait shared by all widgets
# impl WidgetImpl for TodoRow {}
# # // Trait shared by all boxes
# impl BoxImpl for TodoRow {} Now we have to decide which color to use for the borders. Luckily, the stylesheet that GTK uses provides pre-defined colors for various use-cases. As of this writing, the exported colors of the default stylesheet can only be found in its source code . There we find the color borders, which should be used for the widget's border color. We can then access the pre-defined color by adding an @ in front of its name. Filename: listings/todo_app/3/style.css todo-row { border: 1px solid @borders;
